import React from "react";
import styled from "styled-components";
import { makeStyles } from "@material-ui/core/styles";
import { Avatar, Divider } from "@material-ui/core";
import userPhoto from "../../../public/static/sandy.jpeg";
import {
  Container,
  Text,
  SubHeader,
  Header,
  CaptionText,
  SubText,
} from "../../styledComponents";

const useStyles = makeStyles((theme) => ({
  profile: {
    width: theme.spacing(10),
    height: theme.spacing(10),
  },
}));

const SideWrapper = styled(Container)`
  display: flex;
  flex: 0.3;
  padding-left: 110px;
  padding-top: 50px;
  background-color: white;
  flex-direction: column;
`;
const ContentWrapper = styled(Container)`
  display: flex;
  flex: 0.7;
  padding-right: 110px;

  background-color: transparent;
`;
const SingleTenant = (props) => {
  const classes = useStyles();
  return (
    <Container flex={1} row customStyles={{ height: "100%", width: "100%" }}>
      <SideWrapper>
        <Container flex={false} color="transparent" column>
          <Avatar src={userPhoto} className={classes.profile} />
        </Container>
        <Container
          flex={false}
          color="transparent"
          // middle
          // center
          customStyles={{ paddingTop: 10, paddingBottom: 10 }}
        >
          <Header>Rene La</Header>
        </Container>
        <Container
          flex={false}
          color="transparent"
          middle
          column
          customStyles={{ paddingTop: 10, paddingBottom: 10 }}
        >
          <Text>About</Text>
          <CaptionText></CaptionText>
        </Container>
      </SideWrapper>
      <ContentWrapper>
        <Text>Heuuuuuuu youu</Text>
      </ContentWrapper>
    </Container>
  );
};
export default SingleTenant;
